                if (!isRegistered) return await bocchi.reply(from, ind.notRegistered(), id)
                if (!isGroupMsg) return await bocchi.reply(from, ind.groupOnly(), id)
                 if (!q.includes('|')) return await bocchi.reply(from, ind.wrongFormat(), id)
